import styled from 'styled-components'

export const Container = styled.ul`
    width: 18.75rem;
    background-color: rgba(22, 22, 22, 0.65);
    position: relative;
    top: 1.9rem;
    left: -1.09rem;
    padding: 2rem;

    li {
        list-style-type: none;
    }
`;
